Weekend vlog is out on YouTube!

Recently, 2 B747 has been returned to the skies after spending years in the desert storage. How did they do it? The vlog details heavy maintenance, high speed test, rejected takeoff and gear swing.

Listen to the ferry pilot to talk about the reactivation journey and using 747 for good humanitarian cause.

